import classes from "./Media.module.css";

function MediaPage() {
  return (
    <div className={classes.body}>
      <section className={classes.headerSection}>
        <h1>Media</h1>
      </section>
      <section className={classes.bodySection}>
        <h2>Media page coming soon!</h2>
      </section>
    </div>
  );
}

export default MediaPage;
